INSERT INTO `tb_announcements` (`announcement_id`, `announcement_title`, `announcement_content`, `announcement_date`, `announcement_time`, `user_email`) VALUES
(1, 'SMART, Ayo bersama membuat artikel!', 'Wei De Dong Tian,&amp;lt;br /&amp;gt;\n&amp;lt;br /&amp;gt;\nBersama dengan diselenggarakannya DISPENKASI 30, PAKIN Bandung selaku panitia acara DISPENKASI 30 ingin mengajak teman-teman untuk berpartisipasi dalam &amp;lt;strong&amp;gt;SMART&amp;lt;/strong&amp;gt;.\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;SMART&amp;lt;/strong&amp;gt; (Bersama Membuat Artikel) merupakan lomba membuat artikel yang diselenggarakan oleh PAKIN/MAKIN Bandung. Lomba ini bertujuan untuk menggugah semangat dan minat baca/tulis umat Khonghucu khususnya Pemuda Agama Khonghucu Indonesia (&amp;lt;strong&amp;gt;PAKIN&amp;lt;/strong&amp;gt;) mengenai ajaran-ajaran nabi Kongzi yang tertulis dalam kitab Si Shu, Wu Jing dan Xiao Jing.&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;Syarat dan ketentuan untuk mengikuti SMART:&amp;lt;/p&amp;gt;\n\n&amp;lt;ol&amp;gt;\n	&amp;lt;li&amp;gt;Peserta SMART merupakan &amp;lt;u&amp;gt;peserta acara DISPENKASI 30&amp;lt;/u&amp;gt; yakni kelompok atau perseorangan yang berkenan hadir mengikuti acara DISPENKASI 30.&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Kelompok peserta SMART terdiri dari 2-3 orang partisipan.&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Tema artikel adalah: \'&amp;lt;strong&amp;gt;Mengubah Mimpi Menjadi Kenyataan&amp;lt;/strong&amp;gt;\', dengan sub-tema: (i) &amp;lt;strong&amp;gt;Teknologi&amp;lt;/strong&amp;gt;; (ii) &amp;lt;strong&amp;gt;Pendidikan&amp;lt;/strong&amp;gt;; (iii) &amp;lt;strong&amp;gt;Sosial&amp;lt;/strong&amp;gt;; (iv) &amp;lt;strong&amp;gt;Kehidupan&amp;lt;/strong&amp;gt;.&amp;lt;/li&amp;gt;\n&amp;lt;/ol&amp;gt;\n\n&amp;lt;p&amp;gt;Ketentuan teknis mengenai pembuatan artikel dijabarkan sebagai berikut:&amp;lt;/p&amp;gt;\n\n&amp;lt;ol&amp;gt;\n	&amp;lt;li&amp;gt;Model pembuatan artikel tidak dibatasi atau terkait dengan model apapun, namun menjadi penilaian tersendiri jika artikel dibuat dengan ejaan bahasa Indonesia yang baik dan benar, tersusun secara sistematis serta memuat informasi penulis dan sitiran artikel.&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Format file yang diperkenankan untuk dikirim adalah: &amp;lt;strong&amp;gt;.pdf&amp;lt;/strong&amp;gt;.&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;File dikirimkan melalui email dengan judul (subject): &amp;lt;strong&amp;gt;SMART_Kota-Asal_Nama-Penulis-1&amp;lt;/strong&amp;gt;, contoh: SMART_Bandung_Raka-Suryaardi-Widjaja ke alamat: &amp;lt;strong&amp;gt;pakin.bandung@gmail.com&amp;lt;/strong&amp;gt; dengan tembusan (cc) ke alamat: &amp;lt;strong&amp;gt;smart@gr.gurisa.com&amp;lt;/strong&amp;gt;.&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;File dikirimkan selambat-lambatnya &amp;lt;strong&amp;gt;Rabu, 17 Mei 2017&amp;lt;/strong&amp;gt; (deadline).&amp;lt;/li&amp;gt;\n&amp;lt;/ol&amp;gt;\n\n&amp;lt;p&amp;gt;Ketentuan teknis mengenai penilaian artikel:&amp;lt;/p&amp;gt;\n\n&amp;lt;ol&amp;gt;\n	&amp;lt;li&amp;gt;Penilaian sepenuhnya menjadi hak panitia, keputusan akhir panitia tidak dapat diganggu gugat.&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Penilaian didasarkan pada poin-poin penilaian: (i) &amp;lt;strong&amp;gt;Konten artikel&amp;lt;/strong&amp;gt;; (ii) &amp;lt;strong&amp;gt;Tata bahasa penulisan artikel&amp;lt;/strong&amp;gt;; (iii) &amp;lt;strong&amp;gt;Sistematika penulisan artikel&amp;lt;/strong&amp;gt;; (iv) &amp;lt;strong&amp;gt;Kesesuaian dan ketepatan pembuatan artikel&amp;lt;/strong&amp;gt;.&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Penulis dengan artikel yang terpilih oleh panitia akan mendapatkan hadiah berupa: (i) &amp;lt;strong&amp;gt;Uang tunai Rp300.000/artikel&amp;lt;/strong&amp;gt;; (ii) &amp;lt;strong&amp;gt;Hadiah menarik lainnya&amp;lt;/strong&amp;gt;.&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Artikel yang terpilih akan diumumkan selambat-lambatnya &amp;lt;strong&amp;gt;Minggu, 11 Juni 2017&amp;lt;/strong&amp;gt; melalui media sosial PAKIN/MAKIN Bandung dan kontak penulis artikel.&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Artikel yang dipilih oleh panitia wajib dipertanggungjawabkan dalam bentuk: (i) &amp;lt;strong&amp;gt;Penulis artikel bersedia hadir pada acara DISPENKASI 30&amp;lt;/strong&amp;gt;; (ii) &amp;lt;strong&amp;gt;Penulis artikel bersedia memaparkan tulisannya pada saat acara DISPENKASI 30 (presentasi/diskusi/dsb)&amp;lt;/strong&amp;gt;. Jika penulis tidak dapat memenuhi ketentuan teknis ini, hadiah dinyatakan hangus dan panitia akan memilih artikel lain sebagai kandidat artikel terpilih.&amp;lt;/li&amp;gt;\n&amp;lt;/ol&amp;gt;\n\n&amp;lt;p&amp;gt;Lampiran:&amp;lt;/p&amp;gt;\n\n&amp;lt;ol&amp;gt;\n	&amp;lt;li&amp;gt;&amp;lt;a href=&amp;quot;https://gr.gurisa.com/files/SMART.pdf&amp;quot; target=&amp;quot;_blank&amp;quot;&amp;gt;SMART.pdf&amp;lt;/a&amp;gt;&amp;lt;/li&amp;gt;\n&amp;lt;/ol&amp;gt;\n\n&amp;lt;p style=&amp;quot;text-align:right&amp;quot;&amp;gt;Terima kasih,&amp;lt;br /&amp;gt;\nHormat Kami&amp;lt;br /&amp;gt;\n&amp;lt;br /&amp;gt;\n&amp;lt;br /&amp;gt;\n&amp;lt;strong&amp;gt;Panitia DISPENKASI 30&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\n', '2017-02-14', '01:01:34', 'raka@gurisa.com'),
(2, 'Penutupan Pendaftaran Online DISPENKASI 30', '&amp;lt;p&amp;gt;Wei De Dong Tian,&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;Yahoooo~&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;Diberitahukan kepada seluruh partisipan DISPENKASI 30 bahwa periode pendaftaran online DISPENKASI 30 telah berakhir (1 Maret s.d. 9 Juni 2017).&amp;lt;br /&amp;gt;\nHal-hal mengenai perlengkapan yang perlu dipersiapkan oleh partisipan akan kami beritahukan lebih lanjut selambat-lambatnya: Jumat, 16 Juni 2017.&amp;lt;br /&amp;gt;\nSilahkan hubungi panitia melalui koordinator di masing-masing organisasi untuk mengetahui informasi mengenai pendaftaran partisipan.&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;Sampai jumpa di DISPENKASI 30 ya!&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;Terima kasih,&amp;lt;br /&amp;gt;\nHormat Kami&amp;lt;br /&amp;gt;\n&amp;lt;br /&amp;gt;\n&amp;lt;strong&amp;gt;Panitia DISPENKASI 30&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\n', '2017-06-09', '23:57:34', 'raka@gurisa.com'),
(3, 'Congratulation! You are the next SMART', 'Wei De Dong Tian,&amp;lt;br /&amp;gt;\n&amp;lt;br /&amp;gt;\nSelamat kami ucapkan kepada Tim dari PAKIN Citeureup (Dq. Alfian Sun Effendy, Dq. Teguh Badai Bumelar dan Dq. Ricki Cahyadi) dan Dq. Dean Verrell Matalino Ariefin (PAKIN Depok) yang telah terpilih sebagai pemenang sayembara SMART. Kami tunggu performansinya di DISPENKASI 30 ya ^_^.&amp;lt;br /&amp;gt;\n&amp;lt;br /&amp;gt;\nGmna? Kalian juga sudah tidak sabar kan mau lihat langsung gmna serunya SMART yang akan dibawakan oleh mereka? Kehadiranmu kami tunggu di DISPENKASI 30.&amp;lt;br /&amp;gt;\n&amp;nbsp;\n&amp;lt;div style=&amp;quot;text-align:right&amp;quot;&amp;gt;Terima kasih,&amp;lt;br /&amp;gt;\nHormat Kami&amp;lt;br /&amp;gt;\n&amp;lt;br /&amp;gt;\n&amp;lt;strong&amp;gt;Panitia DISPENKASI 30.&amp;lt;/strong&amp;gt;&amp;lt;/div&amp;gt;\n', '2017-06-11', '05:06:59', 'raka@gurisa.com'),
(4, 'Perlengkapan dan Peralatan yang wajib dibawa saat acara DISPENKASI 30', 'Wei De Dong Tian,&amp;lt;br /&amp;gt;\n&amp;lt;br /&amp;gt;\nDiberitahukan kepada seluruh partisipan acara DISPENKASI 30, baik peserta, peninjau, maupun narasumber untuk membawa perlengkapan berikut:&amp;lt;br /&amp;gt;\n&amp;lt;br /&amp;gt;\nSeluruh Partisipan\n&amp;lt;ol&amp;gt;\n	&amp;lt;li&amp;gt;Pakaian secukupnya, formal dan informal, rapih dan sopan. (3 hari 2 malam)&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Pakaian tambahan, penghangat tubuh. (jaket, sweater, dsb)&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Kaos dan celana panjang (training) khusus Jurit Malam, harus siap kotor.&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Alas kaki (sepatu dan sandal).&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Peralatan mandi dan obat-obatan pribadi.&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Botol minum.&amp;lt;/li&amp;gt;\n&amp;lt;/ol&amp;gt;\n&amp;lt;br /&amp;gt;\nPeserta Seminar\n&amp;lt;ol&amp;gt;\n	&amp;lt;li&amp;gt;Kitab Si Shu.&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Buku tulis.&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Alat tulis. (Pensil/Pulpen, penghapus, dsb)&amp;lt;/li&amp;gt;\n&amp;lt;/ol&amp;gt;\n&amp;lt;br /&amp;gt;\nPeserta Minat Bakat&amp;lt;br /&amp;gt;\nA. Musik\n&amp;lt;ol&amp;gt;\n	&amp;lt;li&amp;gt;Alat musik instrumental seperti gitar, keyboard, dsb. (jika memungkinkan)&amp;lt;/li&amp;gt;\n&amp;lt;/ol&amp;gt;\n&amp;lt;br /&amp;gt;\nB. Tari\n&amp;lt;ol&amp;gt;\n	&amp;lt;li&amp;gt;Kaos dan celana olahraga untuk latihan. (2 pasang)&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Kaos putih dan celana kain hitam untuk pentas. (2 pasang)&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Kain samping ukuran 3/4. (2 buah)&amp;lt;/li&amp;gt;\n&amp;lt;/ol&amp;gt;\n&amp;lt;br /&amp;gt;\nC. Bela diri\n&amp;lt;ol&amp;gt;\n	&amp;lt;li&amp;gt;Kaos putih dan celana training berwarna gelap, jika ada silahkan bawa pakaian khusus bela diri Wu Shu. (2 pasang)&amp;lt;/li&amp;gt;\n&amp;lt;/ol&amp;gt;\n&amp;lt;br /&amp;gt;\nApabila ada hal-hal yang kurang dimengerti atau hal yang ingin ditanyakan, silahkan hubungi panitia melalui kontak panitia (https://gr.gurisa.com/dispenkasi/#panitia).&amp;nbsp;&amp;lt;br /&amp;gt;\n&amp;lt;br /&amp;gt;\n&amp;nbsp;\n&amp;lt;div style=&amp;quot;text-align:right&amp;quot;&amp;gt;Terima kasih,&amp;lt;br /&amp;gt;\n&amp;lt;br /&amp;gt;\n&amp;lt;br /&amp;gt;\nHormat Kami&amp;lt;br /&amp;gt;\n&amp;lt;strong&amp;gt;Panitia DISPENKASI 30.&amp;lt;/strong&amp;gt;&amp;lt;/div&amp;gt;\n', '2017-06-16', '19:09:22', 'raka@gurisa.com'),
(5, 'Informasi Pendaftaran Partisipan', 'Wei De Dong Tian,\n&amp;lt;div style=&amp;quot;text-align:justify&amp;quot;&amp;gt;Hai.. hai.. hai..&amp;lt;br /&amp;gt;\nUdah gk sabar ya mau ikut DISPENKASI 30? Kami panitia DISPENKASI 30 sudah menyiapkan banyak kejutan menarik loh, penasaran kan?&amp;lt;br /&amp;gt;\nTapi sebelum itu, kami ingin memberitahukan perihal data pendaftaran partisipan DISPENKASI 30.&amp;lt;br /&amp;gt;\nPastikan seluruh data yang dimasukan saat pendaftaran benar (valid) karena data partisipan akan digunakan untuk pembagian kelas, kamar, kelompok dan sertifikat.&amp;lt;br /&amp;gt;\nDan jangan lupa untuk mempersiapkan dan membawa seluruh perlengkapan untuk DISPENKASI 30 ya!&amp;lt;/div&amp;gt;\n&amp;lt;br /&amp;gt;\nSampai jumpa di DISPENKASI 30!&amp;lt;br /&amp;gt;\n&amp;lt;br /&amp;gt;\n&amp;lt;strong&amp;gt;P.S:&amp;lt;/strong&amp;gt;\n\n&amp;lt;ul&amp;gt;\n	&amp;lt;li&amp;gt;Kamu dapat melihat informasi pribadi kamu langsung melalui website pendaftaran (https://gr.gurisa.com/dispenkasi/#pengumuman)&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Kalau terjadi kesalahan penulisan informasi yang didaftarkan, langsung hubungi panitia sebelum Minggu, 25 Juni 2017 agar dapat segera disesuaikan.&amp;lt;/li&amp;gt;\n	&amp;lt;li&amp;gt;Nanti kalau ketemu jangan sombong ya, admin R. [&amp;gt;_&amp;lt;]/&amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;\n\n&amp;lt;div style=&amp;quot;text-align:right&amp;quot;&amp;gt;Terima kasih.&amp;lt;br /&amp;gt;\nHormat kami,&amp;lt;br /&amp;gt;\n&amp;lt;br /&amp;gt;\n&amp;lt;br /&amp;gt;\n&amp;lt;strong&amp;gt;Panitia DISPENKASI 30.&amp;lt;/strong&amp;gt;&amp;lt;/div&amp;gt;\n', '2017-06-20', '20:28:56', 'raka@gurisa.com');
