INSERT INTO `tb_meta_tags` (`meta_id`, `meta_author`, `meta_keywords`, `meta_description`, `meta_title`) VALUES
('barang', 'MAKIN Bandung', 'data, barang, makin, bandung, dagang, toko, perlengkapan, sembahyang, kitab, suci, si shu, wu jing, xiao jing, hio, lilin, buku, kertas, angpau, baju', 'Belanja di toko MAKIN Bandung yuk!', 'GeeR - Genta Rohani | Data Barang'),
('developer', 'Gurisa.Com', 'gurisa, com, developer, web, programmer, native, oop, data, base, php, ajax, mysql, sql, vb, net, pascal, c, c++, raka, suryaardi, widjaja', 'Gurisa Developers didirikan pada 5 Mei 2015, Gurisa Developers adalah salah satu pengembang yang berfokus pada pembangunan teknologi digital meliputi aspek teknologi masa lalu, masa kini dan teknologi yang akan datang. Dengan berorientasi kepada aspek pengembangan Software, Hardware, Network, dan Development Gurisa Developers mempunyai salah satu tujuan utama yakni membantu perkembangan masyarakat dunia, khususnya Indonesia dalam menghadapi perkembangan teknologi yang kian pesat nya.', 'GeeR - Genta Rohani | Gurisa.Com'),
('dispenkasi', 'MAKIN Bandung', 'confucius, khong hu cu, makin, pakin, bandung, genta, rohani, gr, dispenkasi, 30, bandung, panitia, indonesia', 'Tahun 2045 adalah tahun yang spesial bagi bangsa Indonesia pasalnya, Indonesia akan genap berusia 100 tahun (era Indonesia Emas). Hal ini menjadi momentum terbaik bagi bangsa Indonesia untuk menjadi negara maju dengan pembangunan yang berdasarkan pada Ilmu Pengetahuan dan Teknologi (IPTEK). Dalam rangka mempersiapkan Indonesia emas diperlukan pemuda-pemudi yang tangguh, berwawasan luas dan inovatif, namun saat ini hal tersebut masih bertolak belakang dengan keadaan saat ini. Berdasarkan data Badan Pusat Statistik, pada tahun 2015 Indeks Pembangunan Manusia (IPM) Indonesia berada pada angka 69,55 yang berada pada kelompok sedang dan masih cukup terlampau jauh dari kategori negara maju seperti Singapura dan Malaysia dengan IPM 90,1 dan 77,3.', 'GeeR - Genta Rohani | DISPENKASI 30'),
('index', 'MAKIN Bandung', 'confucius, khong hu cu, makin, pakin, bandung, genta, suci, rohani, gr, data, barang, suara, pendengar, nyanyian, pujian, musik, instrumen, kritik, saran, dispenkasi, 30', 'Wherever you go, go with all your heart.', 'GeeR - Genta Rohani'),
('suara', 'MAKIN Bandung', 'suara, genta, boktok, tian, tuhan, nyanyian, pujian, khonghucu, confucius, agama, rohani', 'Hasil Voting Nyanyian Pujian Pilihan', 'GeeR - Genta Rohani | Suara Genta'),
('suaraku', 'MAKIN Bandung', 'suara, genta, boktok, tian, tuhan, nyanyian, pujian, khonghucu, confucius, agama, rohani', 'Pilih Nyanyian Pujian Kesukaanmu Sekarang Juga!', 'GeeR - Genta Rohani | Suaraku');
