INSERT INTO `tb_quotes` (`quote_id`, `quote_content`, `quote_author`, `quote_source`) VALUES
(1, 'Apa yang berawal darimu, akan kembali kepadamu.', '孔夫子、孔子', ''),
(2, 'Orang yang luar biasa itu sederhana dalam ucapan, tetapi hebat dalam tindakan.', '孔夫子、孔子', ''),
(3, 'Kebanggaan kita yang terbesar adalah bukan tidak pernah gagal, tetapi bangkit kembali setiap kali kita jatuh.', '孔夫子、孔子', ''),
(4, 'Seorang Jun Zi, makan tidak mengutamakan kenyangnya; bertempat tinggal tidak mengutamakan enaknya, ia tangkas di dalam tugasnya dan hati-hati di dalam kata-katanya. Bila mendapatkan seorang yang hidup di dalam Jalan Suci, ia menjadikannya teladan meluruskan hati. Demikianlah seorang yang benar-benar suka belajar.', '孔夫子、孔子', 'Lun Yu I:14'),
(5, 'Belajar dan selalu dilatih, tidakkah itu menyenangkan?', '孔夫子、孔子', 'Lun Yu I:1'),
(6, 'Bila orang tidak mau berfikir tentang kemungkinan yang masih jauh, kesusahan itu tentu sudah berada di dekatnya.', '孔夫子、孔子', 'Lun Yu XV:12'),
(7, 'Di dalam diam, melakukan renungan; belajar, tidak merasa jemu; dan, mengajar orang lain tidak merasa capai; adakah itu dalam diri-Ku?', '孔夫子、孔子', 'Lun Yu VII:2'),
(8, 'Seorang Jun Zi bila tidak menghargai dirinya, niscaya tidak berwibawa; belajarpun tidak akan teguh. Utamakanlah sikap Satya dan Dapat Dipercaya. Janganlah berkawan dengan orang yang tidak seperti dirimu. Bila bersalah janganlah takut memperbaiki.', '孔夫子、孔子', 'Lun Yu I:8'),
(9, 'Banyak-banyaklah belajar, pandai-pandailah bertanya, hati-hatilah memikirkannya, jelas-jelaslah menguraikannya, dan sungguh-sungguhlah melaksanakannya.', '孔夫子、孔子', 'Zhong Yong XIX:19'),
(10, 'Kepada yang tidak mau bersungguh-sungguh, tidak perlu diberi petunjuk. Kepada yang tidak mau berterus-terang, tidak perlu diberi nasihat. Kepada yang sudah diberitahu tentang satu sudut, tetapi tidak mau berusaha mengetahui ketiga sudut yang lain, tidak perlu diberitahu lebih lanjut.', '孔夫子、孔子', 'Lun Yu VII:8'),
(11, 'Harta benda dapat menghias rumah, laku bajik menghias diri; hati yang lapang itu akan membawa tubuh kita sehat. Maka seorang Jun Zi senantiasa mengimankan tekadnya.', '孟子', 'Da Xue VI:4'),
(12, 'Sepuluh mata melihat sepuluh tangan menunjuk, tidakkah itu menakutkan!', '孟子', 'Da Xue VI:3'),
(13, 'Suka belajar itu mendekatkan kita kepada Kebijaksanaan; dengan sekuat tenaga melaksanakan tugas mendekatkan kita kepada Cinta Kasih dan Rasa Tahu Malu mendekatkan kita kepada Berani.', '孔夫子、孔子', 'Zhong Yong XIX:10'),
(14, 'Jangan khawatir orang tidak mengenal dirimu, khawatirlah kalau tidak dapat mengenal orang lain.', '孔夫子、孔子', 'Lun Yu I:16'),
(15, 'Di dalam Kang Gao tertulis, \"Firman itu sesungguhnya tidak berlaku selamanya.\" Maka dikatakan \'yang berbuat baik akan mendapat dan yang berbuat tidak baik akan kehilangan\'.', '', 'Da Xue X:11'),
(16, 'Hati yang tidak pada tempatnya, sekalipun melihat takkan tampak, meski mendengar takkan terdengar dan meski makan takkan merasakan.', '', 'Da Xue VII:2'),
(17, '[...] Maka seorang Jun Zi lebih dahulu menuntut diri sendiri, baharu kemudian mengharap dari orang lain. Bila diri sendiri sudah tak bercacat baharu boleh mengharapkan dari orang lain. Bila diri sendiri belum dapat bersikap Tepasarira, tetapi berharap dapat memperbaiki orang lain, itulah suatu hal yang belum pernah terjadi.', '', 'Da Xue IX:4'),
(18, 'Ada pendidikan, tiada perbedaan.', '孔夫子、孔子', 'Lun Yu XV:39'),
(19, 'Carilah dan engkau akan mendapatkannya. Sia-siakanlah, dan engkau akan kehilangan. Inilah mencari yang berfaedah untuk didapatkan, dan carilah itu di dalam diri.\r\n', '孟子', 'Meng Zi VII A:3.1'),
(20, 'Carilah dengan Jalan Suci, akan hasilnya berserahlah kepada Firman. Inilah mencari yang tidak terlalu berfaedah untuk didapatkan, dan carilah itu di luar diri.', '孟子', 'Meng Zi VII A:3.2'),
(21, 'Hal mendidik itu banyak caranya. Biarpun aku tidak mau memberinya pengajaran, itu sudah berarti memberi pengajaran juga.', '孟子', 'Meng Zi VI B:16'),
(22, 'Begitulah kalau Tuhan Yang Maha Esa hendak menjadikan seorang besar, lebih dahulu disengsarakan batinnya, dipayahkan urat dan tulangnya, dilaparkan badan kulitnya, dimiskinkan sehingga tidak punya apa-apa, dan digagalkan segala usahanya. Maka dengan demikian digerakkan hatinya, diteguhkan Watak Sejatinya, dan bertambah pengertiannya tentang hal-hal yang ia tidak mampu.', '孟子', 'Meng Zi VI B:15.2'),
(23, 'Kalau orang sering menderita, ia tentu akan dapat memperbaiki kesalahannya. Kalau orang sudah banyak menderita dalam hatinya, dan menanggung kesukaran dalam pikirannya, baharulah ia akan bertindak benar-benar. Begitupun dalam berbicara, kalau sudah disertai wajah yang sungguh dan suara yang tegas, baharulah orang mau mengerti.', '孟子', 'Meng Zi VI B:15.3'),
(24, 'Jadi tahulah kita bahwa yang hidup itu berasal dari kepedihan dan penderitaan, dan yang binasa itu karena hanya mau senang gembira saja.', '孟子', 'Meng Zi VI B:15.5'),
(25, 'Seorang yang berperi Cinta Kasih ingin dapat tegak, maka berusaha agar orang lainpun tegak; ia ingin maju, maka berusaha agar orang lainpun maju.', '孔夫子、孔子', 'Lun Yu VI:30.3'),
(26, 'Pagi mendengar akan Jalan Suci, sore hari matipun ikhlas.', '孔夫子、孔子', 'Lun Yu IV:8'),
(27, 'Bersalah tetapi tidak mau memperbaiki, inilah benar-benar kesalahan.', '孔夫子、孔子', 'Lun Yu XV:30'),
(28, 'Seorang Jun Zi lambat bicara tetapi tangkas bekerja.', '孔夫子、孔子', 'Lun Yu IV:24'),
(29, 'Sesungguhnya untuk memperoleh Kegemilangan itu hanya tergantung pada usaha orang itu sendiri.', '', 'Da Xue I:4'),
(30, 'Belajar tanpa berfikir, sia-sia; berfikir tanpa belajar, berbahaya!', '孔夫子、孔子', 'Lun Yu II:15'),
(31, 'Zi Lu, Kuberi tahu apa artinya \'mengerti\' itu! Bila mengerti berlakulah sebagai orang yang mengerti; bila tidak mengerti berlakulah sebagai orang yang tidak mengerti. Itulah yang dinamai \'mengerti\'.', '孔夫子、孔子', 'Lun Yu II:17'),
(32, 'Tiap benda mempunyai pangkal dan ujung, dan tiap perkara itu mempunyai awal dan akhir. Orang yang mengetahui mana hal yang dahulu dan mana hal yang kemudian, ia sudah dekat dengan Jalan Suci.', '', 'Da Xue Bab Utama:3'),
(33, 'Banyak orang berkata, \'aku pandai\', tetapi jika dihalau ke dalam jaring, pikatan atau perangkap, mereka tidak dapat mengetahui bagaimana harus membebaskan diri. Banyak orang berkata, \'aku pandai!\', tetapi jika suatu ketika bertekad hendak hidup di dalam Tengah Sempurna, ternyata tidak dapat mempertahankan sekalipun hanya sebulan.', '孔夫子、孔子', 'Zhong Yong VII:1'),
(34, 'Yang mengerti belum sebanding dengan yang menyukai, sedangkan yang menyukai belum sebanding dengan yang dapat merasa gembira di dalamnya.', '孔夫子、孔子', 'Lun Yu VI:20'),
(35, 'Bila suatu hari dapat membaharui diri, perbaharuilah terus tiap hari dan jagalah agar baharu selama-lamanya!', '', 'Da Xue II:1'),
(36, 'Jalan Suci itu tidak boleh terpisah biar sekejappun. Yang boleh terpisah, itu bukan Jalan Suci. Maka seorang Jun Zi hati-hati teliti kepada Dia yang tidak kelihatan, khawatir takut kepada Dia yang tidak terdengar.', '', 'Zhong Yong Bab Utama:2'),
(37, 'Sekalipun orang tidak mau tahu, tidak menyesali; bukankah ini sikap seorang Jun Zi?', '孔夫子、孔子', 'Lun Yu I:1.3'),
(38, 'Mengetahui seorang yang bijaksana tetapi tidak dapat mengangkatnya atau mengangkatnya tetapi terlambat, itulah lalai akan Firman. Mengetahui seorang yang tidak baik tetapi tidak dapat menyingkirkan atau dapat menyingkirkan tetapi tidak sejauh-jauhnya, itulah kesalahan.', '', 'Da Xue X:16'),
(39, 'Maka seorang Jun Zi bersikap Harmonis, tidak melanda; betapa perwira ia! Bersikap Tengah dalam pendirian dan tidak goyah, betapa perwira ia! Negara di dalam Jalan Suci ia tidak mengubah cita-cita, betapa perwira ia! Negara ingkar dari Jalan Suci, sekalipun binasa ia tidak berubah sikap, betapa perwira ia!', '孔夫子、孔子', 'Zhong Yong IX:5'),
(40, 'Mengetahui Kebenaran tetapi tidak melakukannya, itulah tiada Keberanian.', '孔夫子、孔子', 'Lun Yu II:24.2'),
(41, 'Adapun yang dinamai mengimankan tekad itu ialah tidak mendustai diri sendiri, yakni sebagai membenci bau busuk dan menyukai keelokan. Inilah yang dinamai bahagia di dalam diri sejati. Maka seorang Jun Zi sangat hati-hati pada waktu seorang diri.', '', 'Da Xue VI:1'),
(42, 'Seorang Jun Zi yang bertekad hidup di dalam Jalan Suci, tetapi setengah jalan membatalkan tekadnya; bagi-Ku tidak dapat tidak melanjutkannya.', '孔夫子、孔子', 'Zhong Yong X:2'),
(43, 'Kalau tenaga tidak mencukupi, dapat berhenti di tengah jalan. Mengapa engkau membatasi diri sendiri?', '孔夫子、孔子', 'Lun Yu VI:12.2'),
(44, 'Berlakulah seumpama merawat bayi, bila dengan sebulat hati mengusahakannya, meski tidak tepat benar, niscaya tidak jauh dari yang seharusnya. Sesungguhnya tiada yang harus lebih dahulu belajar merawat bayi baru boleh menikah.', '', 'Da Xue IX:2'),
(45, 'Gembira, marah, sedih, senang, sebelum timbul, dinamai Tengah; setelah timbul tetapi masih tetap di dalam batas Tengah, dinamai Harmonis. Tengah itulah pokok besar daripada dunia dan keharmonisan itulah cara menempuh Jalan Suci di dunia.', '', 'Zhong Yong Bab Utama:4'),
(46, 'Kaya dan berkedudukan mulia ialah keinginan tiap orang, tetapi bila tidak dapat dicapai dengan Jalan Suci, janganlah ditepati. Miskin dan berkedudukan rendah ialah kebencian tiap orang, tetapi bila tidak dapat disingkiri dengan Jalan Suci, jangan ditinggalkan.', '孔夫子、孔子', 'Lun Yu IV:5'),
(47, 'Mengurus hartapun ada Jalannya Yang Besar; bila penghasilan lebih besar daripada pemakaian dan bekerja setangkas mungkin sambil berhemat, niscaya harta benda itu akan terpelihara.', '', 'Da Xue X:19'),
(48, 'Hal memanah itu seperti sikap seorang Jun Zi. Bila memanahnya meleset dari bulan-bulanannya, sipemanah berbalik mencari sebab-sebab kegagalannya di dalam diri sendiri.', '孔夫子、孔子', 'Zhong Yong XIII:5'),
(49, 'Adapun kesalahan seseorang itu masing-masing sesuai dengan sifatnya. Bahkan dari kesalahannya dapat diketahui apakah ia seorang yang berperi Cinta Kasih.', '孔夫子、孔子', 'Lun Yu IV:7'),
(50, 'Adapun sebabnya Jalan Suci itu tidak terlaksana, Aku sudah mengetahui: Yang pandai melampaui, sedang yang bodoh tidak dapat mencapai. Adapun sebabnya Jalan Suci itu tidak dapat disadari jelas-jelas, Aku sudah mengetahui: Yang bijaksana melampaui, sedang yang tidak tahu tidak dapat mencapai.', '孔夫子、孔子', 'Zhong Yong III:1'),
(51, 'Bercitalah menempuh Jalan Suci; Berpangkallah pada Kebajikan; Bersandarlah pada Cinta Kasih; dan Bersukalah di dalam Kesenian.', '孔夫子、孔子', 'Lun Yu VII:6'),
(52, 'Jalan Suci seorang Jun Zi dasarnya terdapat dalam hati tiap pria dan wanita, dan pada puncaknya meliputi segenap Kenyataan yang dapat diteliti di manapun di antara langit dan bumi.', '', 'Zhong Yong XI:4'),
(53, 'Seorang Jun Zi meluaskan pengetahuannya dengan mempelajari kitab-kitab dan membatasi diri dengan Kesusilaan. Dengan demikian ia tidak sampai melanggar Kebajikan.', '孔夫子、孔子', 'Lun Yu VI:27'),
(54, 'Jalan Suci itu tidak jauh dari manusia. Bila orang memaksudkan Jalan Suci itu ialah hal yang menjauhi manusia, itu bukan Jalan Suci.', '孔夫子、孔子', 'Zhong Yong XII:1'),
(55, 'Bertempat tinggal dekat tempat kediaman orang yang berperi Cinta Kasih, itulah yang sebaik-baiknya. Bila tidak mau memilih tempat yang disuasanai Cinta Kasih itu, bagaimana memperoleh Kebijaksanaan?', '孔夫子、孔子', 'Lun Yu IV:1'),
(56, 'Demikianlah Tian Yang Maha Esa menjadikan segenap wujud, masing-masing dibantu sesuai dengan sifatnya. Kepada pohon yang bersemi dibantu tumbuh, sementara kepada yang condong dibantu roboh.', '孔夫子、孔子', 'Zhong Yong XVI:3'),
(57, 'Sayang, aku belum menemukan orang yang setelah dapat melihat kesalahan sendiri lalu benar-benar menyesali dan memperbaiki diri.', '孔夫子、孔子', 'Lun Yu V:27'),
(58, 'Jalan Suci seorang Jun Zi itu seumpama pergi ke tempat jauh, harus dimulai dari dekat; seumpama mendaki ke tempat tinggi, harus dimulai dari bawah.', '孔夫子、孔子', 'Zhong Yong XIV:1'),
(59, 'Hal yang sudah terjadi tidak perlu dipercakapkan, hal yang sudah terlanjur tidak perlu dicegah dan hal yang sudah lampau tidak perlu disalah-salahkan.', '孔夫子、孔子', 'Lun Yu III:21.3'),
(60, 'Maka seorang Jun Zi itu segenap gerakannya turun-temurun akan menjadi Jalan Suci bagi dunia; perbuatannya turun-temurun akan menjadi contoh hukum di dunia; dan kata-katanya turun-temurun akan menjadi pedoman bagi dunia. Maka yang jauh akan mengharapkan dan yang dekat tidak merasa jemu.', '', 'Zhong Yong XXVIII:5'),
(61, 'Tiap hari aku memeriksa diri dalam tiga hal; Sebagai manusia adakah aku berlaku tidak Satya? Bergaul dengan kawan dan sahabat adakah aku berlaku tidak dapat dipercaya? Dan adakah ajaran Guru yang tidak kulatih?', '', 'Lun Yu I:4'),
(62, 'Meskipun berkedudukan bila tidak ber-Kebajikan tidak berani membuat Tata Susila dan Musik. Sekalipun ber-Kebajikan bila tidak berkedudukan, tidak berani membuat Tata Susila dan Musik.', '', 'Zhong Yong XXVII:4'),
(63, 'Adapun sebabnya orang jaman dahulu merasa sukar mengucapkan kata-kata, ialah karena merasa malu kalau tidak dapat melaksanakannya.', '孔夫子、孔子', 'Lun Yu IV:22'),
(64, 'Dikala berkedudukan tinggi ia tidak meremehkan bawahannya, dan di dalam kedudukan rendah ia tidak bersikap menjilat kepada atasannya; ia hanya meluruskan diri dan tidak mencari-cari kesalahan orang lain. Demikianlah maka ia tidak mempunyai rasa sesal. Ke atas ia tidak menyesali Tian dan di bawah tidak menyalahkan sesamanya.', '', 'Zhong Yong XIII:3'),
(65, 'Aku ingin membahagiakan orang-orang yang sudah lanjut usianya, bersikap Dapat Dipercaya kepada kawan dan sahabat, dan mengasuh para muda dengan kasih sayang.', '孔夫子、孔子', 'Lun Yu V:26.5'),
(66, 'Orang bodoh tetapi suka memakai cara sendiri, berkedudukan rendah suka menonjolkan diri, hidup pada jaman ini tetapi ingin menjalankan peraturan-peraturan kuno yang sudah lapuk; perbuatan semacam ini niscaya membawa malapetaka baginya.', '孔夫子、孔子', 'Zhong Yong XXVII:1'),
(67, 'Maka seorang Jun Zi tidak boleh tidak membina diri; bila berhasrat membina diri, tidak boleh tidak mengabdi kepada orang tua; bila berhasrat mengabdi kepada orang tua, tidak boleh tidak mengenal manusia dan bila berhasrat mengenal manusia, tidak boleh tidak mengenal kepada Tian.', '孔夫子、孔子', 'Zhong Yong XIX:7'),
(68, 'Adapun yang dinamai berbakti ialah dapat baik-baik meneruskan pekerjaan mulia orang tuanya.', '孔夫子、孔子', 'Zhong Yong XVIII:2'),
(69, 'Ada orang yang sejak lahir sudah bijaksana, ada yang karena belajar lalu bijaksana, dan ada yang karena menanggung sengsara lalu bijaksana; tetapi Kebijaksanaan itu Satu juga. Ada orang yang dengan tenang-tenteram dapat menjalani, ada yang karena melihat faedahnya lalu dapat menjalani dan adapula yang dengan susah payah memaksa diri untuk menjalani. Tetapi hasilnya akan Satu juga.', '孔夫子、孔子', 'Zhong Yong XIX:9'),
(70, 'Bila kekayaan itu merupakan syarat untuk dapat mencapai (cita-cita tertinggi), meskipun harus menjadi tukang membawa cambuk, Aku mau menjalaninya; tetapi, karena bukan merupakan syarat, lebih baik Aku mengikuti kesukaan-Ku.', '孔夫子、孔子', 'Lun Yu VII:12'),
(71, 'Dengan makan nasi kasar, minum air tawar dan tangan dilipat sebagai bantal, orang masih dapat merasakan kebahagiaan di dalamnya. Maka harta dan kemuliaan yang tidak berlandaskan Kebenaran, bagi-Ku laksana awan yang berlalu saja.', '孔夫子、孔子', 'Lun Yu VII:16'),
(72, 'Tiap kali jalan bertiga, niscaya ada yang dapat Kujadikan guru, Kupilih yang baik, Kuikuti; dan yang tidak baik, Kuperbaiki.', '孔夫子、孔子', 'Lun Yu VII:22'),
(73, 'Mungkin ada orang yang sesungguhnya tidak mengerti, tetapi ingin ikut-ikut melakukan; Aku tidak akan berbuat seperti itu. Banyaklah mendengar, ambillah yang baik dan ikutilah. Banyaklah melihat dan ingat-ingatlah di dalam hati. Orang yang demikian dapat digolongkan orang pandai tingkat kedua.', '孔夫子、孔子', 'Lun Yu VII:28'),
(74, 'Seorang Jun Zi menjunjung tinggi tiga syarat hidup di dalam Jalan Suci. Di dalam sikap dan lakunya, ia menjauhkan sikap congkak dan angkuh; pada wajahnya selalu menunjukkan sikap Dapat Dipercaya dan di dalam percakapannya selalu ramah tamah serta menjauhi kata-kata yang kasar.', '孔夫子、孔子', 'Lun Yu VIII:4.3'),
(75, 'Cakap, tetapi suka bertanya kepada yang tidak cakap; berpengetahuan luas tetapi suka bertanya kepada yang kurang pengetahuan; berkepandaian tetapi kelihatan tidak; berisi tetapi nampak kosong; tidak mendendam atas perbuatan buruk orang lain; dahulu aku mempunyai seorang teman yang dapat melakukan ini.\r\n', '曾子', 'Lun Yu VIII:5'),
(76, 'Apa yang boleh bagi rakyat, biarlah dilaksanakan; yang tidak boleh, biarlah diketahui.', '孔夫子、孔子', 'Lun Yu VIII:9'),
(77, 'Seorang yang menyukai keberanian tetapi takut sengsara, akan menjadi pengacau. Yang tidak berperi Cinta Kasih bila terlalu dibenci, iapun akan menjadi pengacau.', '孔夫子、孔子', 'Lun Yu VIII:10'),
(78, 'Hanya orang yang benar-benar dengan penuh kepercayaan suka belajar, baharulah ia dapat memuliakan Jalan Suci hingga matinya.', '孔夫子、孔子', 'Lun Yu VIII:13.1'),
(79, 'Bila Negara di dalam Jalan Suci, ia merasa malu hidup sengsara dan hina; tetapi, bila Negara ingkar dari Jalan Suci, ia merasa malu hidup kaya dan mulia.', '孔夫子、孔子', 'Lun Yu VIII:13.3'),
(80, 'Di dalam belajar hendaklah seperti engkau tidak dapat mengejar dan khawatir seperti engkau akan kehilangan pula.', '孔夫子、孔子', 'Lun Yu VIII:17'),
(81, 'Adakah Aku mempunyai banyak pengetahuan? Tidak banyak pengetahuan-Ku! Tetapi kalau datang seorang yang sederhana bertanya dengan kekosongan hati; dengan berpegangan pada kedua ujung persoalan yang dikemukakannya, Aku akan berusaha baik-baik memecahkan persoalannya.', '孔夫子、孔子', 'Lun Yu IX:8'),
(82, 'Bila kupandang, terasa bertambah tinggi; semakin kugali, terasa bertambah dalam. Kadang-kadang kupandang nampak berdiri di muka, sekonyong-konyong ternyata ada di belakang.', '顏 淵', 'Lun Yu IX:11.1'),
(83, 'Di luar rumah dapat mengabdi kepada Pemerintah, di dalam rumah dapat mengabdi kepada orang tua dan saudara-saudara, di dalam hal kematian tidak berani tidak bersungguh-sungguh dan tidak bermabuk dengan anggur, inilah yang selalu menjadi pertanyaan. Apakah Aku sudah dapat menjalankan!', '孔夫子、孔子', 'Lun Yu IX:16'),
(84, 'Di antara benih yang tumbuh ada yang tidak berbunga, dan di antara yang berbunga ada pula yang tak berbuah.', '孔夫子、孔子', 'Lun Yu IX:22'),
(85, 'Yang dapat diajak belajar bersama, belum berarti dapat diajak bersama menempuh Jalan Suci; yang dapat diajak menempuh Jalan Suci, belum berarti dapat diajak bersama berteguh; dan yang dapat diajak berteguh, belum berarti dapat terus bersesuaian paham.', '孔夫子、孔子', 'Lun Yu IX:30.1'),
(86, 'Betapa indah bunga Tang Di. Selalu bergoyang menarik. Bukan aku tidak mengenangmu, hanya tempatmu terlampau jauh.“Sesungguhnya engkau tidak memikirkannya benar-benar, Kalau benar-benar, apa artinya jauh?”', '孔夫子、孔子', 'Lun Yu IX:30.2'),
(87, 'Walaupun tanpa mendapat teladan-teladan yang baik, ia dapat pula berbuat baik; tetapi kalau hanya demikian, ia tidak akan memperoleh kesempurnaan.', '孔夫子、孔子', 'Lun Yu XI:20'),
(88, 'Yang tidak susila jangan dilihat, yang tidak susila jangan didengar, yang tidak susila jangan dibicarakan, dan yang tidak susila jangan dilakukan.', '孔夫子、孔子', 'Lun Yu XII:1.3'),
(89, 'Keluar rumah hendaklah bersikap sebagai menjumpai tamu agung; mengabdikan diri kepada rakyat, bersikap sebagai melakukan Sembahyang Besar. Apa yang diri sendiri tiada inginkan, janganlah diberikan kepada orang lain. Dengan demikian di dalam negeri tidak disesali, di dalam keluarga pun tidak disesali.', '孔夫子、孔子', 'Lun Yu XII:2.2'),
(90, 'Mengapakah hati-hati dalam bicara dapat dinamai berperi Cinta Kasih?\r\n“Melaksanakan sesuatu itu sukar, maka dapatkah orang tidak hati-hati dalam bicara?”', '孔夫子、孔子', 'Lun Yu XII:3.2'),
(91, 'Pada waktu mencintai seseorang, mengharapkan hidup terus; setelah benci, mengharapkan mati. Inilah pikiran sesat. Sungguh ini bukan pembawa bahagia, melainkan ajakan pikiran sesat.', '孔夫子、孔子', 'Lun Yu XII:10.3'),
(92, 'Bagi seorang Jun Zi, nama itu harus sesuai dengan yang diucapkan dan kata-kata itu harus sesuai dengan perbuatannya. Itulah sebabnya seorang Jun Zi tidak gampang-gampang mengucapkan kata-kata.', '孔夫子、孔子', 'Lun Yu XIII:3.7');
